import React, { Component } from 'react';

import ResponsiveDrawer from './Layout';
import Router from './Router'

class IndexTutorial extends Component {

  constructor() {
    super();
  }

  render() {
    return (
      <div>
        <ResponsiveDrawer />
        <Router/>
      </div>
    );
  }
}

export default IndexTutorial;
